import React from 'react';
import styles from './styles/Carousel.module.css';

export default function Carousel() {
  return (
    <div id="carouselExampleSlidesOnly" className={`${styles.Carousel} carousel slide`} data-ride="carousel">
      <div className="carousel-inner">
        <div className="carousel-item active" data-interval="500">
          <img src="/carrousel/carrousel-item-1.jpg" className="d-block w-100" alt="..." />
        </div>
        <div className="carousel-item" data-interval="500">
          <img src="/carrousel/carrousel-item-2.jpg" className="d-block w-100" alt="..." />
        </div>
        <div className="carousel-item">
          <img src="/carrousel/carrousel-item-3.jpg" className="d-block w-100" alt="..." />
        </div>
      </div>
    </div>
  );
}
